-- ----------------------------
-- Table structure for etl_exec_record
-- ----------------------------
DROP TABLE IF EXISTS `etl_exec_record`;
CREATE TABLE `etl_exec_record`  (
  `EXECID` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `RENTERID` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `OWNER` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `NAME` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `TYPE` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `STATUS` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `OPERATOR` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `BEGIN` datetime(0) NULL DEFAULT NULL,
  `END` datetime(0) NULL DEFAULT NULL,
  `READLINES` bigint(20) NULL DEFAULT NULL,
  `WRITELINES` bigint(20) NULL DEFAULT NULL,
  `OTHERLINES` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `SUCCESSFAILTIMES` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `CONFIGURATION` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL,
  `OUTPUTSOURCE` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  PRIMARY KEY (`EXECID`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

